import {FETCH_DATA_TO_TABLE_SUCCESS, FETCH_DATA_TO_TABLE_FAILURE} from 'actionTypes'

const initialState = {data:{},error:false}

export default (state=initialState, {type,payload})=>
{
  switch (type) {
    case FETCH_DATA_TO_TABLE_SUCCESS:
      return {data:payload, error:false}
    case FETCH_DATA_TO_TABLE_FAILURE:
      return {data:{}, error:true}
    default:
      return state
  }
}
